-----

My list is long!

I want to walk away from

1. self-doubt and self-criticism for everything which I have not been able to complete yet

2. only being focussed on the result, not on the process

3. comparing myself and focusing on the opinions and perspectives of others and the outside world more than on what is true for me

4. letting myself being convinced of what I should and have to do to be successful, investing in things, that in the end did not help me instead of listening to my intuition and my definition of success

5. unhealthy and limiting thoughts, feelings, and habits

.......

6 months away from my daily life has pushed me out of a subconscious hamster-wheel too and made visible a lot of "old" and very limiting belief- systems, which needed to be healed already for a long long time.

My wish is to focus on a new perspective and walk towards:

1. self-value & self-love, to be gentle with myself, celebrating EVERYTHING I have done so far - especially all my growth and my strength

2. enjoying every step of the way towards becoming and being the vision of my higher self

3. focussing on my path and my steps and trusting my truth

4. choosing very careful my mentors and advice of others, following my definition of success

5. new self-loving, valuing thoughts, feelings and habits

Because today I understand I am worthy of my immense love first. Thank you life for all these lessons and all this growth 

What are you willing to walk away from?

